The error is caused because the keyword `include` is not correctly used. In C programming, the correct keyword is `#include`. The `#include` directive is used to include the contents of any other file in the program at the time of preprocessing.

The corrected code should be:

```c
#include <stdio.h>

int main(void) {
   printf("Hello, world!\n");
   return 0;
}
```

In this corrected code, `#include <stdio.h>` is used to include the standard input/output library in C. This library is necessary for the `printf` function used in the program. Also, it's a good practice to return a value from the `main` function, typically `return 0;` is used to indicate that the program has run successfully.
